  height: 512,
  width: 512,
  svgPath: 'M8 256c0 136.966 111.033 248 248 248s248-111.034 248-248S392.966 8 256 8 8 119.033 8 256zm248 184V72c101.705 0 184 82.311 184 184 0 101.705-82.311 184-184 184z',
  yOffset: 0,
  xOffset: 0,
  transform: ''
};
export const AdjustIcon = props => {
  const newProps = Object.assign({
    config: AdjustIconConfig
